DROP TABLE IF EXISTS `dynamic_table`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `dynamic_table` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '动态的标题可为空',
  `content` longtext COLLATE utf8mb4_unicode_ci COMMENT '动态内容，内容为原始HTML内容转译后的内容',
  `send_user_id` int DEFAULT NULL COMMENT '发送者ID',
  `send_time` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '发送的时间',
  `dynamic_status` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '动态状态，0为封禁，1为正常',
  `img_list` longtext COLLATE utf8mb4_unicode_ci COMMENT '动态图片列表使用英文状态逗号分隔带后缀名',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
